    if (_imageOfHookTurn)
        return _imageOfHookTurn;

    UIGraphicsBeginImageContextWithOptions(CGSizeMake(200, 200), NO, 0.0f);
    [YZIconKit drawHookTurn];
    _imageOfHookTurn = UIGraphicsGetImageFromCurrentImageContext();
    UIGraphicsEndImageContext();

    return _imageOfHookTurn;
}

